import { View, Text, Image, FlatList, StyleSheet } from "react-native";

interface Items {
    image: string;
    name: string;
    rating: number;
    price: string;
}

const FlatListImage = () => {
  const items = [
    {
      id: 1,
      image:
        "data:image/jpeg;base64,",
      name: "Mclaren 1",
      rating: 3.5,
      price: "$90000",
    },
    {
      id: 2,
      image:
        "data:image/jpeg;base64,",
      name: "Mclaren 1",
      rating: 3.5,
      price: "$90000",
    },
    {
      id: 3,
      image:"data:image/jpeg;base64,",
      name: "Mclaren 2",
      rating: 3.7,
      price: "$100000",
    },
    {
      id: 4,
      image: "data:image/jpeg;base64,",
      name: "Mclaren 3",
      rating: 3.5,
      price: "$90000",
    },
    {
      id: 5,
      image:
        "data:image/jpeg;base64,",
      name: "Mclaren 4",
      rating: 6.5,
      price: "$70000",
    },
    {
      id: 6,
      image:
        "data:image/jpeg;base64,",
      name: "Mclaren 5",
      rating: 5.5,
      price: "$88000",
    },
  ];

  const renderItem = ({ item } : {item: Items}) => {
    return(
    <View style={styles.itemContainer}>
      <Image style={styles.image} source={{ uri: item.image }} />
      <Text style={styles.name}>{item.name}</Text>
      <Text style={styles.rating}>Rating: {item.rating}</Text> 
      <Text style={styles.price}>Price: {item.price}</Text>
    </View>
    )
  };
  // Now let me just write some code and then you will get to know what i'm taking about.

  return (
    <View>
      <FlatList
        data={items}
        keyExtractor={(item, index) => index.toString()}
        renderItem={renderItem}
      />
    </View>
  );
};


const styles = StyleSheet.create({
    itemContainer: {
        flex: 1,
        alignItems: 'center',
        padding: 10,
        marginBottom: 10,
        backgroundColor: '#fff',
        borderRadius: 10,
        shadowColor: '#000',
        shadowOffset: {width: 0, height: 2},
        shadowOpacity: 0.1,
        shadowRadius: 5,
        elevation: 5,
    },
    image: {
        width: 200,
        height: 300,
        borderRadius: 10,
    },
    name: {
        fontSize: 18,
        fontWeight: 'bold',
        marginTop: 10,
    },
    rating: {
        fontSize: 16,
        color: '#888',
        marginTop: 5,
    },
    price: {
        fontSize: 16,
        color: '#000',
        marginTop: 5,
    }

})
export default FlatListImage;
